import React from 'react';
import TeamMemberCard from '../components/TeamMemberCard/TeamMemberCard';
import castingIcon from '../images/castingIcon.png';
import Navbar from '../components/NavigationBar/Navbar'
import Footer from '../components/Footer/Footer'
import ImageComponent from '../components/ImageComponent/ImageComponent'
const App = () => {
  const teamMembers = [
    {
      name: "Salvador de Castro",
      role: "Director",
      bio: "Text breu sobre la seva funció",
      imageUrl: castingIcon
    },
    {
      name: "Jane Smith",
      role: "Marketing Manager",
      bio: "Jane oversees our marketing strategies and campaigns to reach a wider audience.",
      imageUrl: "https://example.com/profile-image.jpg"
    },
    // Add more team members to the array
  ];

  return (
    <div>
      <Navbar />
      <ImageComponent src={EquipTecnic} alt="Equip tecnic" text="Equip humà" />
      <div className="team-grid">
        <div className="team-grid__cards">
          {teamMembers.map((teamMember, index) => (
            <TeamMemberCard
              key={index}
              name={teamMember.name}
              role={teamMember.role}
              bio={teamMember.bio}
              imageUrl={teamMember.imageUrl}
            />
          ))}
        </div>
      </div>
      <Footer />
    </div>

  );
};

export default App;
